import React from "react";
import './App.css';

function Footer (props) {
 return (
     <div className="footer">
     <pre className="tab">
        <p> Data provided by
          <a href="https://api.nasa.gov/" target="_blank"
            rel="noopener noreferrer" > NASA API </a>
            Chris Pieper
            </p>
      </pre>
     </div>
 );
}

export default Footer;
